import styled from 'styled-components';

export const OrderCell = styled.div`
  width: 40%;
  margin: 40px auto;
  background: grey;
  padding: 3%;
  .input-label {
    display: flex !important;
  }
  input[type=checkbox]{
    margin-top: 6px;
    margin-right: 4px;
  }
`;
